import introPhoto from '../../assets/intro.png';
import styled from 'styled-components';

const MainWrapper = styled.div``;
const ImgCover = styled.img`
  width: 100%;
`;

export default function Intro() {
  return (
    <MainWrapper>
      <ImgCover src={introPhoto} />
    </MainWrapper>
  );
}
